import React, { useState, useEffect } from "react";
import axios from "axios";

function ViewRating() {
    // State to hold the view rating data
    const [view, setview] = useState([]);

    // Fetch view rating data from the API
    useEffect(() => {
      axios.get("http://localhost/COMP333_HW3/index.php/viewrating")
        .then((response) => {
          setview(response.data);
        })
        .catch((error) => {
          console.error("Error fetching view rating data:", error);
        });
    }, []);

    return (
      <div>
        <h1>View Rating</h1>
        <ul>
          {view.map((view) => (
            <li key={view.id}>
              Username: {view.username}, Artist: {view.artist}, Song: {view.song}, Rating: {view.rating}
            </li>
          ))}
        </ul>
      </div>
    );
  }

  export default ViewRating;
